import React, {Component} from 'react';
import { Link } from 'react-router-dom';

class Search extends Component{
    constructor(props){
        super(props)
        this.state = {
            city:null
        }
    }


    handleSubmit= (event) =>{
        event.preventDefault()
    }    
    handleInputChange = (event) =>{
        event.preventDefault()
        console.log(event.target.name)
        console.log(event.target.value)
        this.setState({
            [event.target.name] : event.target.value
        })

    }

    render(){
        const {city} =this.state
    return (
        <div className="Search">
            <h2>Find your place</h2>
            <br/>
            <form onSubmit={this.handleSubmit}>
                <label className="ci"><b>City:</b>
                    <input type="text" name="city" value={city} placeholder="input city name"
                    onChange={this.handleInputChange}/>
                </label>
                <br/>
                <label className="ci"><b>Surburb:</b>
                    <input type="text" name="suburb" placeholder="input suburb name"/>  
                </label>
                <br/>
                <label className="ci"><b>Check in:</b>
                <input type="date" name="check in" placeholder="input check in date"/>
                </label>
                <br/>
                <label className="ci"><b>Check out:</b>
                    <input type="date" name="check out" placeholder="input check out date"/>
                </label>
                <br/>
                <button className="sea_button">
                    <h3>search</h3>
                </button>
            </form>


        </div>
    );
    }
}
export default Search;
